import React from "react";
import { useSelector } from "react-redux";

function Dashboard() {
    const { user } = useSelector((state) => state.user)
  return (
    <div>
      <h1>hello Dashboard{user}
      </h1>
      
    </div>
  );
}

export default Dashboard;
